import React, { Component } from "react";
import CardFood from "../home/CardFood";

class Food extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <CardFood />
        <CardFood />
      </div>
    );
  }
}
export default Food;
